<html>

<head>
<meta name="GENERATOR" content="Microsoft FrontPage 4.0">
<title>Image Cutter Output File</title>
<link rel="stylesheet" type="text/css" href="custom.css">
</head>

<body>
<div align="center">
  <center>
<table border="0" cellspacing="0" cellpadding="0" height="194" width="780">
  <tr>
    <td height="23" width="60"><img src="pageslice1.jpg" height="23" width="60" border="0"></td>
    <td rowspan="3" height="173" width="118"><img border="0" src="userimages/_userimg-varphoto5.jpg" width="118" height="173"></td>
    <td height="23" width="424"><img src="pageslice3.jpg" height="23" width="424" border="0"></td>
    <td height="23" width="178" background="pageslice4.jpg" align="right">
      <p class="SMtext">#AUTODATESTAMP#&nbsp; </p>
    </td>
  </tr>
  <tr>
    <td height="86" width="60"><img src="pageslice5.jpg" height="86" width="60" border="0"></td>
    <td height="86" width="424" valign="middle" align="center">
      <p class="logohead">#LOGO#</td>
    <td rowspan="2" height="150" width="178" valign="middle" align="center">#LOGOIMG#</td>
  </tr>
  <tr>
    <td height="64" width="60"><img src="pageslice8.jpg" height="64" width="60" border="0"></td>
    <td height="64" width="424" valign="middle" align="center">
      <p class="logosub">#SLOGAN#</td>
  </tr>
  <tr>
    <td colspan="2" height="149" width="178" valign="top" align="left" background="pageslice10.jpg" STYLE="background-repeat: no-repeat;">
      <table border="0" cellpadding="0" cellspacing="0" width="178">
        <tr>
          <td height="155"></td>
        </tr>
        <tr>
          <td>#VMENU#</td>
        </tr>
        <tr>
          <td height="12"><img border="0" src="blank.gif" width="1" height="1"></td>
        </tr>
        <tr>
          <td>
            <p class="boxcontent1">#BOX1#</td>
        </tr>
      </table>
    </td>
    <td colspan="2" height="1" width="602" valign="top" align="left">
      <table border="0" cellpadding="4" cellspacing="0" width="602">
        <tr>
          <td>
            <p class="sohotext">#CONTENT#</td>
        </tr>
      </table>
    </td>
  </tr>
</table>
  </center>
</div>
<div align="center">
  <center>
  <table border="0" cellpadding="0" cellspacing="0" width="780">
    <tr>
      <td valign="middle" align="center" background="pageslice3.jpg" height="23">
        <p class="SMtext">#COPYRIGHT#</td>
    </tr>
  </table>
  </center>
</div>
<p>#CUSTOMINC#</p>
</body>
</html>
